---
layout: default
title: other
---

<h1 class="category-title">other</h1>
<div class="post-list">
  {% for post in site.posts %} {% if post.categories contains "other" %}
  <div class="post-list-entry">
    <div class="post-entry-title">
      <a href="{{ post.url }}">{{ post.title }}</a>
    </div>
  </div>
  {% endif %}{% endfor %}
</div>
